import React, { Component } from 'react'
import Particles from 'react-particles-js';

export class Background extends Component {
    render() {
        return (

            <Particles
    params={{
	    "particles": {
	        "number": {
	            "value": 160,
	            "density": {
	                "enable": false
	            }
	        },
	        "size": {
	            "value": 10,
	            "random": true
	        },
	        "move": {
	            "direction": "bottom",
	            "out_mode": "out"
	        },
	        "line_linked": {
	            "enable": false
	        }
	    },
	    "interactivity": {
	        "events": {
	            "onclick": {
	                "enable": true,
	                "mode": "remove"
	            }
	        },
	        "modes": {
	            "remove": {
	                "particles_nb": 10
	            }
	        }
	    }
	}}

	height={window.outerHeight}

		style={{
		width: '100%',
		height:"100vh"
		}}/>

        )
    }
}

export default Background
